import React from "react";
import { nikeAir } from "./data";

export const Stocks = () => {
  return (
    <>
      <div className="stock-container">
          {nikeAir.map((data,key)=>{
              return(
                  <div key={key}>
                      <h3>{data.name}</h3>
                      <p>{data.year}</p>
                      <img src={data.image} style="max-width 200px"></img>
                  </div>
                  
              )
          })}
      </div>
    </>
  );
};
